function AboutMe() {
   return (
   <section>
    <div className='h-screen grid'>
      <div>
        <p className='aboutme opacity-75 mt-96 font-bold flex'>ABOUT ME</p>
        <p className=' ml-48 absolute subtitle -mt-48  text-4xl w-8/12'>Front-end developer who loves to design
        and implement for the best user experience. Deeply into machine learning algorithms and their efficiency
        in embedded platforms.</p>
      </div>
    </div>
    </section>
   );
}


export default AboutMe;
